class Solution {
  int gcd(int a, int b) {
    return b == 0 ? a : gcd(b, a % b);
  }

  bool canTraverseAllPairs(List<int> nums) {
    int n = nums.length;
    List<List<int>> graph = List.generate(n, (_) => []);
    for (int i = 0; i < n; ++i) {
      for (int j = i + 1; j < n; ++j) {
        if (gcd(nums[i], nums[j]) > 1) {
          graph[i].add(j);
          graph[j].add(i);
        }
      }
    }

    List<bool> visited = List.filled(n, false);
    void dfs(int node) {
      visited[node] = true;
      for (int neighbor in graph[node]) {
        if (!visited[neighbor]) {
          dfs(neighbor);
        }
      }
    }

    dfs(0);
    for (bool v in visited) {
      if (!v) return false;
    }
    return true;
  }
}
